// SPDX-License-Identifier: MIT
pragma solidity ^0.8.5;

import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "@openzeppelin/contracts/proxy/utils/Initializable.sol";

/**
 * @title Funds manager
 * @author Piotr Buda
 */
contract FundsManager is AccessControl, Ownable, Initializable {
    using SafeERC20 for ERC20;

    //ROLES
    bytes32 public constant SONGS_MANAGER = keccak256("SONGS_MANAGER");
    bytes32 public constant SONG_CONTRACT = keccak256("SONG_CONTRACT");
    bytes32 public constant TRANSFER_STABLECOIN = keccak256("TRANSFER_STABLECOIN");
    bytes32 public constant STAKING = keccak256("STAKING");

    struct StablecoinWithdrawal {
        address stablecoin;
        uint256 amount;
    }

    //STATE
    /**
     *@dev keeps track of how many tokens of each kind have been staked
     */
    mapping(address => uint256) private _reserves;

    /**
     * @dev whitelist of supported stablecoins
     */
    mapping(address => bool) private tokenWhitelist;

    address[] public stablecoins;

    address private immutable traxToken;

    mapping(address => mapping(address => uint256)) private _waitlist;

    //EVENTS

    /**
     * @param _songsManagerAddress the address of the SongsManager contract
     * @param _traxToken the address of the TRAX token
     * @param _initialWhitelist a list of stablecoin addresses to whitelist
     */
    constructor(
        address _songsManagerAddress,
        address _traxToken,
        address[] memory _initialWhitelist
    ) {
        require(_traxToken != address(0), "Invalid TRAX address");
        _setRoleAdmin(SONG_CONTRACT, SONGS_MANAGER);
        _setupRole(SONGS_MANAGER, _songsManagerAddress);
        traxToken = _traxToken;
        for (uint256 i = 0; i < _initialWhitelist.length; i++) {
            tokenWhitelist[_initialWhitelist[i]] = true;
        }
        stablecoins = _initialWhitelist;
    }

    /**
     * @param _stakingAddress the address of the Staking contract
     */
    function initialize(address _stakingAddress) external initializer {
        _setupRole(TRANSFER_STABLECOIN, _stakingAddress);
        _setupRole(STAKING, _stakingAddress);
    }

    function updateSongStaking(
        uint256 stakedTraxAmount,
        address stablecoinAddress,
        uint256 stakedStablecoinAmount
    ) external onlyRole(SONG_CONTRACT) {
        _update(stablecoinAddress, stakedStablecoinAmount);
        _reserves[traxToken] += stakedTraxAmount;
    }

    function updateStaking(address stablecoin, uint256 amount) external onlyRole(STAKING) {
        _update(stablecoin, amount);
    }

    function _update(address stablecoin, uint256 amount) internal {
        require(tokenWhitelist[stablecoin], "Unsupported stablecoin");
        _reserves[stablecoin] += amount;
    }

    function transferBeatsTo(
        address receiver,
        address beatsToken,
        uint256 amount
    ) external onlyRole(SONG_CONTRACT) {
        //TODO: add proper checks and update beats state before transfer
        ERC20(beatsToken).safeTransfer(receiver, amount);
    }

    function transferTraxTo(address receiver, uint256 amount) external onlyRole(SONG_CONTRACT) {
        require(_reserves[traxToken] >= amount, "Not enough TRAX balance");
        _reserves[traxToken] -= amount;
        ERC20(traxToken).safeTransfer(receiver, amount);
    }

    function transferStablecoinTo(
        address receiver,
        address stablecoinAddress,
        uint256 amount
    ) external {
        require(
            hasRole(SONG_CONTRACT, msg.sender) || hasRole(TRANSFER_STABLECOIN, msg.sender),
            "Unauthorized to call transferStablecoinTo"
        );
        require(tokenWhitelist[stablecoinAddress], "Unsupported stablecoin");
        require(amount / 10**(ERC20(stablecoinAddress).decimals() - 2) > 0, "Cannot withdraw less than 0.01");
        uint256 balanceOfStablecoin = _reserves[stablecoinAddress];
        StablecoinWithdrawal[] memory withdrawals = new StablecoinWithdrawal[](stablecoins.length);
        uint256 requestedTokenAmount = amount > balanceOfStablecoin ? balanceOfStablecoin : amount;
        uint256 missingAmount = amount > balanceOfStablecoin ? amount - balanceOfStablecoin : 0;

        uint256 withdrawalsCounter = 0;
        if (requestedTokenAmount > 0) {
            withdrawals[withdrawalsCounter] = StablecoinWithdrawal(stablecoinAddress, requestedTokenAmount);
            withdrawalsCounter++;
        }

        for (uint256 i = 0; i < stablecoins.length; i++) {
            if (missingAmount > 0 && stablecoins[i] != stablecoinAddress) {
                uint256 normalizedMissingAmount = _normalizeToToken(
                    stablecoins[i],
                    stablecoinAddress,
                    missingAmount
                );
                if (_reserves[stablecoins[i]] >= normalizedMissingAmount) {
                    withdrawals[withdrawalsCounter] = StablecoinWithdrawal(
                        stablecoins[i],
                        normalizedMissingAmount
                    );
                    missingAmount = 0;
                } else {
                    withdrawals[withdrawalsCounter] = StablecoinWithdrawal(
                        stablecoins[i],
                        _reserves[stablecoins[i]]
                    );
                    missingAmount -= _normalizeToToken(
                        stablecoinAddress,
                        stablecoins[i],
                        _reserves[stablecoins[i]]
                    );
                }
                withdrawalsCounter++;
            }
        }

        if (missingAmount > 0) {
            _waitlist[receiver][stablecoinAddress] += amount;
        } else {
            for (uint256 i = 0; i < withdrawalsCounter; i++) {
                _reserves[withdrawals[i].stablecoin] -= withdrawals[i].amount;
                ERC20(withdrawals[i].stablecoin).safeTransfer(receiver, withdrawals[i].amount);
            }
        }
    }

    function _normalizeToToken(
        address destToken,
        address srcToken,
        uint256 amount
    ) private view returns (uint256) {
        uint8 destDecimals = ERC20(destToken).decimals();
        uint8 srcDecimals = ERC20(srcToken).decimals();
        if (destDecimals == srcDecimals) {
            return amount;
        }

        return
            destDecimals > srcDecimals
                ? amount * 10**(destDecimals - srcDecimals)
                : amount / 10**(srcDecimals - destDecimals);
    }

    function reservesOf(address token) external view returns (uint256) {
        return _reserves[token];
    }

    function whitelistStablecoin(address stablecoinAddress) external onlyOwner {
        require(stablecoinAddress != address(0), "Invalid stablecoin address");
        require(!tokenWhitelist[stablecoinAddress], "Stablecoin already supported");
        tokenWhitelist[stablecoinAddress] = true;
        stablecoins.push(stablecoinAddress);
    }

    function isSupported(address token) external view returns (bool) {
        return tokenWhitelist[token];
    }

    function isOnWaitlist(address account, address stablecoin) external view returns (bool) {
        return _waitlist[account][stablecoin] > 0;
    }
}

